package main

import (
    "fmt"
    "net"
    "strconv"
    "time"
)

func checkPort(ipAddr string, port int, timeout time.Duration) {
    conn, err := net.DialTimeout("tcp", ipAddr+":"+strconv.Itoa(port), timeout)
    if err != nil {
        fmt.Printf("Port %d is closed\n", port)
        return
    }

    conn.Close()
    fmt.Printf("Port %d is open\n", port)
}

func main() {
    // Replace X.X.X.X with the IP address you want to scan
    ipAddr := "X.X.X.X"

    startPort := 1
    endPort := 65535
    timeout := 1 * time.Second

    for port := startPort; port <= endPort; port++ {
        go checkPort(ipAddr, port, timeout)
    }

    // Quick fix - sleeping to allow all go routines to avoid terminating quickly
    time.Sleep(5 * time.Second)
}
```

